import React from "react";
import { Container, Button, Row } from "reactstrap";
import { NavLink, Link } from "react-router-dom";

const linky = [
  {
    path: "/home",
    display: "Home",
  },
  {
    path: "#",
    display: "About",
  },
  {
    path: "/tours",
    display: "Tours",
  },
];

const Header = () => {
  return <div>Header</div>;
};

export default Header;
